import React from 'react';
import { NavLink } from 'react-router-dom';

export const Signup = () => {
  return (
    <>
    <div class="d-grid gap-2 col-6 mx-auto">
    <NavLink to={`/registracija`} className="btn btn-outline-dark"><span className="fa-regular fa-magnifying-glass " ></span> Registracija</NavLink>
</div>


    </>
  )
}
